import React from "react";
import { Link } from "react-router-dom";
import logo from "../logo.svg";

const Navbar = () => {
	return (
		<nav>
			<div className="nav-center">
				<Link to="/">
					<img src={logo} alt="cocktail db logo" className="logo" />
				</Link>
			</div>
		</nav>
	);
};

export default Navbar;
